import "./App.scss";

const numberOfFields = 5;

const matrix = Array.from({ length: numberOfFields }, () =>
  Array.from({ length: numberOfFields }, () => ({
    id: Math.random() * 100,
  }))
);

console.log(matrix);

function App() {
  return (
    <div className="App">
      <h1>Hello matrix</h1>

      <div>
        {matrix.map((rowArray, i) => (
          <div key={i} id={i}>
            {rowArray.map((cell, ci) => (
              <div
                key={ci}
                id={`${i}-${ci}`}
                style={{
                  padding: "3px",
                  border: "1px solid grey",
                  cursor: "pointer",
                }}
              >
                {cell}
              </div>
            ))}
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
